  const key_b64 = "jbtYStoNkw9Se6Ed33qALkpLLv2mNd6TvZyzHbJIBOU=";

  function b64ToArr(b64){ 
    const s = atob(b64); 
    const arr = new Uint8Array(s.length); 
    for (let i=0;i<s.length;i++) arr[i]=s.charCodeAt(i); 
    return arr;
  }

  try{
    const keyRaw = b64ToArr(key_b64);
    const cryptoKey = await crypto.subtle.importKey("raw", keyRaw, "AES-GCM", false, ["decrypt"]);

    async function decryptEntry(entry){
      try{
        const iv = b64ToArr(entry.iv);
        const ct = b64ToArr(entry.ct);
        const tag = b64ToArr(entry.tag);
        const ctTag = new Uint8Array(ct.length + tag.length);
        ctTag.set(ct, 0);
        ctTag.set(tag, ct.length);
        const plain = await crypto.subtle.decrypt({name:"AES-GCM", iv: iv, tagLength: 128}, cryptoKey, ctTag);
        const decoder = new TextDecoder();
        return decoder.decode(plain);
      }catch(e){
        return null;
      }
    }

    const promises = encrypted.map(e => decryptEntry(e));
    const results = await Promise.all(promises);
    const numbers = results.filter(Boolean).map(s => s.replace(/[^0-9]/g, ''));
